// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.5.0 <0.9.0;

contract crowdFunding
{
    mapping(address=>uint) public conntributors;
    address public manager;
    uint public target;
    uint public miniContribution;
    uint public raisedAmnt;
    uint public deadline;
    uint public noOfContributor;

    constructor(uint _target,uint _deadline)
    {
        target=_target;
        deadline=block.timestamp+_deadline;
        manager=msg.sender;
        miniContribution=100 wei;
    }

    function sendEth() public payable 
    {
        require(msg.value>=100 wei,"You dont Eligible");
        require(block.timestamp<deadline,"Deadline had come");

        if (conntributors[msg.sender]==0){
            noOfContributor++;
        }
        conntributors[msg.sender]+=msg.value;
        raisedAmnt+=msg.value;
    }

    function getBalance() public view returns(uint)
    {
        
    }

}

